    {url:'/', urlname:'home'},
    {url:'/shop/All-island', urlname:'all-shop'},
    {url:'/create-shop', urlname:'create-shop'},
    {url:'/create-item', urlname:'create-item'},
    {url:'/create-catagery', urlname:'create-catagery'},
    {url:'/myorder', urlname:'my-order'},
]

